import React from 'react';
import { Component } from 'react';
import styled from 'styled-components';

const Container = styled.div`
  height : 60px;
  width : 100vw;
  background-color : rgb(52, 58 , 64);
`

class Nav extends Component {
	render(){
		return(
			<Container>
				Nav
			</Container>
		);
	};

}

export default Nav;
